DefinicjaElementu.Tekst:
public void %NAZWA%_Param(%TYP% Element, WypSkladnik Składnik) {
    Składnik.Podstawa1 = 0m;
//  Składnik.Procent = new Percent(0.0834m); 
    Składnik.Procent = Element.DodHistoria.Procent;

    FromTo okres = new Okres(Element.Okres).Rok(0);
//  FromTo okres = new Okres(Element.Okres).Rok(1);
////Msg("Okres={0}", okres);

// Suma wynagrodzenia zasadniczego
    foreach (WypElement e in Element.Elementy[okres, WypElement.Zasadnicze])
        Składnik.Podstawa1 += e.Wartosc;
////Msg("Zasadnicze={0}", Składnik.Podstawa1);

// Suma innych niż zasadnicze elementów wynagrodzenia
    Składnik.Podstawa2 = 0m;
    foreach (WypElement e in Element.Elementy[okres, WypElement.CechaDef("Nagroda roczna"),
        Bool.AND, Bool.NOT,
        WypElement.Zasadnicze]) {
        Składnik.Podstawa2 += e.Wartosc;
///Msg("Dodatek={0}", e.Wartosc);
    }
}

public Currency %NAZWA%_Wylicz(%TYP% Element, WypSkladnik Składnik) {
    return (Składnik.Podstawa1+Składnik.Podstawa2)*Składnik.Procent;
}
